import React, { useState, useEffect } from "react";
import CardsList from "./test";
import "./App.css";
/* import Create from "./test";
 */ const App = () => {
  const [movies, setMovie] = useState([]);
  const api =
    "https://api.themoviedb.org/3/search/movie?api_key=fac34116c639f3e75cd5205251be421c&query=search";

  useEffect(() => {
    fetch(api)
      .then((res) => res.json())
      .then((res) => setMovie(res.results));
  }, []);

  return (
    <div className="container">
      <div className="clm">
        {movies.map((movie) => (
          <CardsList
            key={movie.id}
            title={movie.title}
            overview={movie.overview}
            img={movie.poster_path}
          />
        ))}
        {console.log(movies)}
      </div>
    </div>
  );
};

export default App;
